import './App.css';
import Header from './components/layouts/header';
import Main from './components/layouts/main';
import Footer from './components/layouts/footer';
import { BrowserRouter,Route } from 'react-router-dom';
import Login from './components/authentication/login';
import Register from './components/authentication/register';
import ContactList from './components/contacts/contactList';
import ContactDetails from './components/contacts/contactDetails';
import Message from './components/messages/message';
import MessageList from './components/messages/messageList';
// import ProtectedRoute from './components/route/protectedRoute';
import { useSelector } from 'react-redux';
function App() {
  const ProtectedRoute = ({ component: Component, ...rest }) => {
      // console.log("Component",Component)
      const { isAuthenticated, loading, error } = useSelector(state => state.auth);
      console.log("isAuthenticated",isAuthenticated)
  }
  return (
    <BrowserRouter>
    <div className="App">
      <Header/>
      <Route path="/" component={Main} exact></Route>
      <Route path="/login" component={Login} exact></Route>
      <Route path="/register" component={Register} exact></Route>
      <ProtectedRoute path="/contacts" component={ContactList} exact></ProtectedRoute>
      <Route path="/contactDetails" component={ContactDetails} exact></Route>
      <Route path="/sendMessage" component={Message} exact></Route>
      <ProtectedRoute path="/messages" component={MessageList} exact></ProtectedRoute>

      {/* <Main/> */}
      <Footer/> 
    </div>
    </BrowserRouter>
  );
}

export default App;
